import React from 'react';
import '../App/App.css';
import Banner from '../Banner/Banner';

const homeInfo = {
    title: 'Home',
    path: '/',
    cName: 'nav-text',
    imageSrc: '../images/profile.png',
    name: 'home'
}

function Home() {
    return (
        <div className='home'>
            
            <Banner 
            imageSrc = {homeInfo.imageSrc}/>
        </div>
    )
}

export default Home;
